import {FcDeleteDatabase} from "react-icons/fc";
const CartItem = ({item}) => {
  return (
    <div className="flex w-full gap-5 items-center mb-10">
      <div className="w-[400px]">
        <img src={item.image} className="object-fill h-[200px]" alt="addedProduct"/>
      </div>
      <div className="max-w-[400px]">
        <p className="font-bold mb-2">{item.title}</p>
        <p className="mb-4">{item.description}</p>
        <div className="flex justify-between">
          <p className="font-semibold">${item.price}</p>
          <button className="w-[40px] h-[40px] bg-green-100 flex items-center justify-center rounded-full">
              <FcDeleteDatabase fontSize={20}/>
          </button>
        </div>
      </div>
    </div>
  )
};

export default CartItem;
